import React from 'react'
import { useNavigate } from 'react-router-dom';

function NavigateToHome(){
    const navigate = useNavigate();

    navigate("/");
}

function NavigateToLink(denumire){
    const navigate = useNavigate();

    navigate("/" + denumire);
}

function Navbar2() {
    
    return (
        <div className='navbar'>
            <div className='containerNavbarButtons'>
                <button id="menuAbout" value="About"></button>
                <a href='#' id="menuAbout" onclick="NavigateToHome()">About</a>
                <a href='#' id="menuRegister" onclick="NavigateToLink(register)">Register</a>
                <a href='#' id="loginMenu">Login</a>
                <a href='#' id="menu">Menu</a>
            </div>
        </div>
    )
}

export default Navbar2;
